import React from 'react';
import './card-styles.css';

export const Card = props => (
    <div className='card-container'>
        <img 
        alt='monster' 
        src={`https://robohash.org/${props.keyNo}?set=set2&size=180x180`} />
        <h2>{props.monster}</h2>
        <p>{props.monster.email}</p>
    </div>
);
